                [cdkDropListConnectedTo]="[doneList]" 
                class="empty flex align-items-center justify-content-center"
            >
            <img *ngIf="fourthContainer.length" [src]="fourthContainer[0].src" alt="">
            </div>
            <p *ngIf="fourthContainer.length" class="empty_p">Агрус</p>
        </div>
    </div>


    <div 
        cdkDropList 
        #doneList="cdkDropList" 
        cdkDropListOrientation="horizontal" 
        [cdkDropListData]="firstContainer"
        [cdkDropListConnectedTo]="[empty1, empty2, empty3]"
        class="images-container"
    >
        <img cdkDrag *ngFor="let element of firstContainer" [src]="element.src" class='image' [alt]="element.alt">
    </div>
</div>
<div class="progress-bar">
    <p-progressBar [value]="progressValue" [showValue]="false"></p-progressBar>
</div>
